--------------------------------------------------------
--  DDL for Trigger TRIGGER1
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "ZHAO"."TRIGGER1" 
after update on zhao.stutocou
for each row
declare
  creditcore number;
  totalcredit number;
  temp number;
begin
  select credit into creditcore
  from zhao.course where cou_id=:old.cou_id;
  
  select totalcredits into totalcredit
  from zhao.student where stuid=:old.stu_id;
  
  temp:=0;
  if:new.scores>=100 then
    temp:=100-1;
  else
    temp:=:new.scores;
  end if;
  if:new.scores>=60 then
      if:old.scores>=60 then
        update zhao.student set gpa=gpa-trunc(:old.scores/10)+trunc(temp/10)
        where stuid=:old.stu_id;
      else
        update zhao.student set gpa=gpa+trunc(temp/10),
        totalcredits=totalcredits+creditcore
        where stuid=:old.stu_id;
      end if;
  elsif totalcredit<>0 then
      update zhao.student set gpa=gpa-trunc(:old.scores/10),
        totalcredits=totalcredits-creditcore
        where stuid=:old.stu_id;
  end if;
end;
/
ALTER TRIGGER "ZHAO"."TRIGGER1" ENABLE;
